import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <Router>
      <div className="app">
        <Routes>
          <Route
            exact
            path="/"
            element={
              <div>
                <Header />
                <Home />
              </div>
            }
          />
          <Route
            exact
            path="/dashboard"
            element={
              <div>
                <Header />
                <Dashboard />
              </div>
            }
          />
          <Route
            exact
            path="/projects"
            element={
              <div>
                <Header />
                <Project />
              </div>
            }
          />
          <Route
            exact
            path="/about"
            element={
              <div>
                <Header />
                <About />
              </div>
            }
          />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
